export default function MainPage() {
  return (
    <div >
        <p>Квіти для всіх</p>
        <p>Отримуйте насолоду від магії миті: природа чекає лише на ваше відкриття!</p>
        <button>Вибрати букет</button>
    </div>
  );
}
